"____EXAMPLE____091": |
  =begin code
  my Gnome::Glib::Variant $v .= new-variant( 'u', guint32, 40);
  =end code

"____EXAMPLE____092": |
  =begin code
  enum VFlags ( :AAA(1), :BBB(2), :CCC(4), :DDD(8));
  my GFlag $some-flags = AAA +| DDD;
  my $some-strings = CArray[Str].new( 'a', 'b', 'c', Str);
  my Gnome::Glib::N-Variant $v .= new-variant(
    '(t^as)', GFlag, $some-flags, CArray[Str], $some-strings
  );
  =end code

